Choose your country and enjoy the best radios and music with high quality sound within ergonomic interface.

Popular radio stations with music for everyone are waiting for you in the Radio application. It is extremely simple, clear and beautiful app!

- Enjoy great sound quality;
- Move radio stations and line up your favourite stations one by one; 
- Observe the names and artists of the songs playing; 
- Set a sleep timer; 
- Control music on the fly.

Participate in the life of the project and let us know about radio stations that are not yet in the application but you would like to enjoy listening to.




Subscribe to access the app without ads. After you confirm the purchase, payment will go through your iTunes account. Subscriptions are auto-renewed, unless auto-renewal is disabled at least 24 hours before the end of the current subscription period. Auto-renewal takes place within a 24-hour span immediately prior to the expiration of the current subscription period, for a term identical to the previous term. Any unused time from the free trial period is annulled when you subscribe.
You can manage your subscriptions and disable auto-renewal in your account settings.

